const newList = {
  products: [
    {
      id: "32324234",
      proName: "华为V20",
      price: 5999,
      inventory: 10
    },
    {
      id: "3234424234",
      proName: "iPhoneXr",
      price: 12999,
      inventory: 10
    },
    {
      id: "321324234",
      proName: "1+6T",
      price: 3999,
      inventory: 10
    },
    {
      id: "3231224234",
      proName: "小米Max4",
      price: 6999,
      inventory: 10
    }
  ]
};
const rootReducer = (state = newList, action) => {
  switch (action.type) {
    case "GET_PRO":
      return state;
      break;

    default:
      break;
  }
  return state;
};

export default rootReducer;
